import Expenseitem from "./components";
import ExpenseTask from "./components/Expenses/ExpenseTask";
import './components/Expenses/ExpenseApp.css'

function App() {
 const Expdetails =[
   {thatDay: new Date('05 October 2021 14:48 UTC'),title:'Electricity',rate:397 },
   {thatDay: new Date('06 October 2012 14:48 UTC'),title:'Wifi',rate:500 },
   {thatDay: new Date('07 October 2021 14:48 UTC'),title:'Vegitables',rate:200 },
   {thatDay: new Date('08 October 2021 14:48 UTC'),title:'Mobile Prepaid',rate:200 },
   {thatDay: new Date('2 November 2021 14:48 UTC'),title:'others',rate:700 },

]
  return (

      <div className="expenses">
      <ExpenseTask Expdetails={Expdetails} />
      </div>


  );
}

export default App;
